import React from 'react';

function List(props) {
  const [addingMovie, setAddingMovie] = useState(true);

  const prepAddMovie = (movie) => {
    <MovieSetup trigger={addingMovie} setTrigger={setAddingMovie} RnR={props.RnR} setRnR={props.setRnR}/>
  }

    return (
      <div className="item-container">
        {props.items.map((movie, index)=> (
          <div key={index} className="items">
            <img src={movie.Poster} alt='movie' className='movie-image'></img>
            <div onClick={prepAddMovie(movie)} className="overlay"></div>
          </div>
        ))}
      </div>
    )
}

export default List;
